                    -a[0]*c[0,0]/9 - a[0]*c[4,0]/18 - a[0]*c[5,0]/9 - a[1]*c[0,1]/9 - a[1]*c[4,1]/18 - a[1]*c[5,1]/9 - a[2]*c[0,2]/9 - a[2]*c[4,2]/18 - a[2]*c[5,2]/9 - a[3]*c[0,3]/9 - a[3]*c[4,3]/18 - a[3]*c[5,3]/9 - a[4]*c[0,4]/9 - a[4]*c[4,4]/18 - a[4]*c[5,4]/9 - a[5]*c[0,5]/9 - a[5]*c[4,5]/18 - a[5]*c[5,5]/9,
                    -a[0]*c[0,0]/9 - a[0]*c[4,0]/9 - 2*a[0]*c[5,0]/9 - a[1]*c[0,1]/9 - a[1]*c[4,1]/9 - 2*a[1]*c[5,1]/9 - a[2]*c[0,2]/9 - a[2]*c[4,2]/9 - 2*a[2]*c[5,2]/9 - a[3]*c[0,3]/9 - a[3]*c[4,3]/9 - 2*a[3]*c[5,3]/9 - a[4]*c[0,4]/9 - a[4]*c[4,4]/9 - 2*a[4]*c[5,4]/9 - a[5]*c[0,5]/9 - a[5]*c[4,5]/9 - 2*a[5]*c[5,5]/9,
                    -a[0]*c[0,0]/9 - 2*a[0]*c[4,0]/9 - a[0]*c[5,0]/9 - a[1]*c[0,1]/9 - 2*a[1]*c[4,1]/9 - a[1]*c[5,1]/9 - a[2]*c[0,2]/9 - 2*a[2]*c[4,2]/9 - a[2]*c[5,2]/9 - a[3]*c[0,3]/9 - 2*a[3]*c[4,3]/9 - a[3]*c[5,3]/9 - a[4]*c[0,4]/9 - 2*a[4]*c[4,4]/9 - a[4]*c[5,4]/9 - a[5]*c[0,5]/9 - 2*a[5]*c[4,5]/9 - a[5]*c[5,5]/9,
                    -a[0]*c[0,0]/9 - a[0]*c[4,0]/9 - a[0]*c[5,0]/18 - a[1]*c[0,1]/9 - a[1]*c[4,1]/9 - a[1]*c[5,1]/18 - a[2]*c[0,2]/9 - a[2]*c[4,2]/9 - a[2]*c[5,2]/18 - a[3]*c[0,3]/9 - a[3]*c[4,3]/9 - a[3]*c[5,3]/18 - a[4]*c[0,4]/9 - a[4]*c[4,4]/9 - a[4]*c[5,4]/18 - a[5]*c[0,5]/9 - a[5]*c[4,5]/9 - a[5]*c[5,5]/18,
